import React from "react";
function ZingItem({song}){
    return(
        <>
            <li className="ZingItem">
                <a href="123">
                <div className="ZingItems-img">
                        <img 
                            alt={song.song} 
                            className="HistoryImg" 
                            src={song.img}
                        />
                        </div>
                        <p className="title">{song.song}</p>
                        <p className="text">{song.singer}</p>
                </a>
            </li>
        </>
    )
}
export default ZingItem;
